import React from "react";
import { Link } from "react-router-dom";
import { Nav } from "react-bootstrap";

const TestComponent = () => {
    return (
        <div>
            <Nav>
                <Nav.Item>
                    <Link to="/" className="nav-link">
                        Home
                    </Link>
                </Nav.Item>
                <Nav.Item>
                    <Link to="/favorites" className="nav-link">
                        Favorites
                    </Link>
                </Nav.Item>
                <Nav.Item>
                    <Link to="/profile" className="nav-link">
                        Profile
                    </Link>
                </Nav.Item>
            </Nav>

            {/* Esto es solo para mostrar que el link de React Router funciona */}
            <h1>Prueba de Navegaci√≥n con React-Router</h1>
        </div>
    );
};

export default TestComponent;
